import React from "react";

import "./style.scss";
import { ComponentProps } from "./types";

const ControlledInput: React.FC<ComponentProps> = ({ data }) => {
  const dataOptions = data.map((e) => {
    <option value={e.title} key={Math.random() * Math.random()} />;
  });

  return (
    <form>
      <input list="browsers" name="browser" />
      <datalist id="browsers">
        <option value={data[0].title} />
        <option value="Firefox" />
        <option value="Chrome" />
        <option value="Opera" />
        <option value="Safari" />
        {dataOptions}
      </datalist>
      <input type="submit" />
    </form>
  );
};

export default ControlledInput;
